branch-defaults:
  monty:
    environment: BackendAPI-dev
environment-defaults:
  BackendAPI-dev:
    branch: monty
    repository: origin
  BackendAPI-dev2:
    branch: monty
    repository: origin
global:
  application_name: BackendAPI
  default_ec2_keyname: aws-eb
  default_platform: arn:aws:elasticbeanstalk:us-west-2::platform/Python 3.4 running
    on 64bit Amazon Linux/2.5.0
  default_region: us-west-2
  include_git_submodules: true
  instance_profile: null
  platform_name: null
  platform_version: null
  profile: eb-cli
  sc: git
  workspace_type: Application
